ぽたぽた漏水のまま、巻き付けるだけのカンタン補修テープ。圧力が掛かっている状態でも補修できます。<br />●テープ同士が自己融着して破損部を塞ぎます。<br />●水質安全基準合格品<br />●レクターアーロンテープ<br />●シリコンラバーテープ補修材<br />●金属、プラスチック、PVC、FRP、セラミック、ガラス、ゴムなど、ほとんどのパイプやホースの補修。<br />●材質:シリコンラバー<br />●耐圧力:圧力に応じて重ね巻き<br />●引張強度:7.0MPa<br />●耐熱温度:-50～200℃<br />●伸び率:440％<br />●品質保持期間:製造日より2年間(常温保管)<br />●食品衛生法第370号、第85号承認<br />●JIS K6353(水道用ゴム)承認、米軍規格適合品(MIL-I-46852C)<br />1回のご購入合計金額(税込)が【5,400円以上】の場合は送料無料です。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。<br />1回のご購入合計金額(税込)が【5,400円未満】の場合は送料がかかります。<br />送料は全国一律540円(重量10kgまで)、沖縄県は10kgまで1,620円を申し受けます。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。●メーカー:ユニテック<br />●型式:SR-2<br />●テープ幅×長さ:25mm×2m<br /><br />●出荷目安:即日出荷<br><br>


