乾けば金属のように硬化！耐圧・耐熱にも優れ、補修硬化は半永久的で、硬化後は研磨・塗装も可能です。<br />●大掛かりな補修工事不要で経済的です。<br />●レクターハイテープ<br />●グラスファイバー製布テープ補修材<br />●金属、プラスチック、PVC、FRP、セラミック、ガラス、コンクリート、ゴムなどの配管やホースの補修及び補強。特に薬品やオイルを使用する配管に適しています。<br />●パイプの漏れや破損に、水を浸して巻きつけるだけの補修です。<br />●巻き数：6～8回程度<br />●硬化時間：約30分(外気温21℃の場合)※レクターシールとの併用をお薦めします。<br />●硬化した際の硬度：ショアーD53<br />●耐熱温度：-15～210℃<br />●引張り強度：1600Kg/cm2<br />●耐圧：10Kg/cm2<br />●硬度：53barcol<br />●品質保持期間：製造日より2年間(開封後は使い切ってください)<br />●ファイバーグラステープ(アルミパック入り)付き<br />●ゴムグローブ：1双<br />●パット<br />1回のご購入合計金額(税込)が【5,400円以上】の場合は送料無料です。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。<br />1回のご購入合計金額(税込)が【5,400円未満】の場合は送料がかかります。<br />送料は全国一律540円(重量10kgまで)、沖縄県は10kgまで1,620円を申し受けます。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。●メーカー:ユニテック<br />●型式:RH-1<br />●テープ幅×長さ:25mm×0.75m<br />●パイプ径:1/4B-1/2B<br /><br />●出荷目安:3営業日以内<br><br>


